import React from 'react';
import ReactDOM from 'react-dom';

let Name = "Himanshu";


ReactDOM.render(

    <>
        <h1>Hi My Name Is {Name}</h1>
        <p>My Age Is {9+10}</p>
        <p>Random Luck Is {Math.random}</p>

    </>,
    document.getElementById('root')

);
